script: |
  super -f text -I q602.spq | sort > q602.out

inputs:
  - name: q602.spq
    data: |
      SELECT DISTINCT + col0 + + col0 * col2 FROM tab0 (FORMAT parquet) WHERE ( NULL ) BETWEEN ( col0 * col2 * col2 - - col0 ) AND - col2 * - col0 + + col1;
  - name: tab0

outputs:
  - name: q602.out
    data: |
